rs</h6>

<p style="font-size: 14px;" class="font_8"><em>March 5, 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">Our partner and sponsor is a company Iredale Mineral Cosmetics. Jane Iredale is the president and founder of Iredale Mineral Cosmetics, a company she founded in 1994 which brought the mineral makeup line &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; to the aesthetic industry. She was the first to supply this industry with a line of makeup that had skin care benefits.</p>

