<p style="font-size: 14px;" class="font_8"><em>June 11, 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">Libelle team continues to move across Europe. At this time, our stylists are going directly to the two tournaments. The first -<span style="font-weight:bold;"> Italian Open Championship</span> <span style="font-weight:bold;">2015</span>&nbsp;<span style="font-size:16px;"><span style="line-height:1.5em;"><span style="font-weight:bold;"> </span></span></span><span style="font-weight:bold;">(XXXI I.O.C. ITALIAN OPEN CHAMPIONSHIP - FE.IN.DA. 2015</span>)<span style="font-size:16px;"><span style="line-height:1.5em;">, </span></span>which will be held from <span style="font-weight:bold;">26 to 28 June 2015</span> at Palazzetto dello Sport, Riccione (Italy).</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">The second tournament – <span style="font-weight:bold;">FESTIVALDANZA</span> – will be held in the Palazzetto dello Sport, Via Pinarella, 66 Cervia RA&nbsp; <span style="font-weight:bold;">25-28 June 2015</span>.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">On results we will tell you in our reports.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

