<p style="font-size: 14px;" class="font_8"><span style="font-style:italic;">July 12, 2015</span></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">Libelle team returned from Italy, where from 26 to 28 July, was held two dance events - Open Championship of Italy (XXXI IOC ITALIAN OPEN CHAMPIONSHIP - FE.IN.DA. 2015) and FESTIVALDANZA.<br>
<br>
In addition to new impressions and moods of summer incendiary Italy our stylists brought many victories obtained by dancers whose images were created by Libelle team.<br>
<br>
And we are ready to show you images of dancers made by our stylists on the page REPORTS.</p>

<p style="font-size: 14px;" class="font_8">&nbsp;</p>

<p style="font-size: 16px;" class="font_7">(websites of events &nbsp; &nbsp; &nbsp;&nbsp; http://www.italianopenchampionship.com/</p>

